input="""



"""
# input="""ULL
# RRDDD
# LURDL
# UUUUD"""
array = input.split("\n")
answer = []

# x x 1 x x
# x 2 3 4 x
# 5 6 7 8 9
# x A B C x
# x x D x x

pad = [[0,0,1,0,0],[0,2,3,4,0],[5,6,7,8,9],[0,"A","B","C"],[0,0,"D",0,0]]

# up [-1,0]
# down [+1,0]
# left [0,-1]
# right [0,+1]

# start at 5
current = [2,0]

for move in array:
	for letter in move:
		# print(str(pad[current[0]][current[1]])+"|" + letter + "|" + str(current) )
		# Make sure you dont try to go outside the pad. 
		try:
			if letter == "U" and pad[current[0]-1][current[1]]!=0 and current[0] > 0:
				current = [current[0]-1,current[1]]

			if letter == "D" and pad[current[0]+1][current[1]]!=0 and current[0] <4:
				current = [current[0]+1,current[1]]

			if letter == "L" and pad[current[0]][current[1]-1]!=0 and current[1] > 0:
				current = [current[0],current[1]-1]

			if letter == "R" and pad[current[0]][current[1]+1]!=0 and current[1] < 4:
				current = [current[0],current[1]+1]
		except:
			#Hit the boundaries of the pad.
			pass
      
  #Add the button to the answer.
	answer.append(pad[current[0]][current[1]])

#Answer 
print(answer)
